webpackJsonp([26585481647324],{427:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Спортивная ходьба - не менее эффективный способ поддерживать себя в хорошей физической форме, чем бег.  </p>\n<p>Данной дисциплиной можно заниматься и для оздоровления организма, и на профессиональном уровне, готовясь к соревнованиям.  </p>\n<p>В отличие от обычной ходьбы, у спортивной есть свои преимущества и недостатки, о которых следует знать любому человеку, который решил выбрать именно эту спортивную дисциплину.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n    <li>Встаньте на беговую дорожку</li>\n    <li>Выберите подходящий режим (Walking, Cardio, manual)</li>\n    <li>Постепенно увеличьте скорость до 7км/ч</li>\n    <li>Постепенно повышайте уровень угла подъема дорожки</li>\n    <li>Достаточно ходить всего 30 минут, после чего стоит сделать отдых тоже на 30 минут</li>\n</ol>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/oX8j00FgUwQ" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/sportivnaja-hodba",efficiency:"7",title:"Спортивная ходьба на беговой дорожке",image:"/static/6-01-0.jpg",image_2:"",image_3:"",image_4:"",filterby:"cardio",date:"April 12, 2017",injury:"2",bodypart:"Кардио",filtertype:"base",type:"Базовое",filterinventory:"ownweight",inventory:"Собственный вес",filterplace:null}}},pathContext:{}}}});
